import React  from "react";
class Data extends React.Component{

        state={
            name:"abc",
            city:"banglore"
        }
    
    render(){
        return(
            <div>
            <h2>abc</h2>
            {this.state.name} {this.state.city}
            
            </div>
        )
    }
}
export default Data;
